import ExpenseItem from "./ExpenseItem"
import Card from "../UI/Card"
import "./Expenses.css"
import ExpensesFilter from "./ExpensesFilter"

import { useState } from "react";

function Expenses ( props )
{
    let expanses = props.items;
    
    const [filteredYear,setFilteredYear] = useState("2020");

    const FilterValueChangeHandler = ( selectedYear ) =>
    {
        console.log(selectedYear);
        setFilteredYear(selectedYear);
    }
    return (
     <div>
    <Card className="expenses"> 
    <ExpensesFilter filterValue={filteredYear} onFilterValueChanged = {FilterValueChangeHandler}></ExpensesFilter>
    // eslint-disable-next-line
    {expanses.map(expanse => {<ExpenseItem title={expanse.title} amount={expanse.amount} date={expanse.date}></ExpenseItem>})}
    </Card>
    </div>
    );
}

export default Expenses;
